        <div>
            <label>
                <p>Insert City</p>
                <input></input>
            </label>

            <div> {data.name}</div>
        </div>
    );
};

export async function getServerSideProps(ctx) {
    const coords = { lat: 49.99395, lon: 18.333241 };
    const url =
        "https://geocode.search.hereapi.com/v1/geocode?q=Invalidenstr+117%2C+Berlin&apiKey=FI0ZPYdRRTTdhdTKQwENNV-OAS4OA13qj97BqtkoU2M";
    // const url = `https://api.openweathermap.org/data/2.5/weather?lat=${coords.lat}&lon=${coords.lon}&appid=ba590e34cd2c5e9d9bfa284e3f0b6a6e`;
    const res = await fetch(url);
    const data = await res.json();
    console.log(data.items);
    return { props: { data } };
}

export default index;
